import{_ as t,o as a,c as o,Q as s}from"./chunks/framework.1a5fad36.js";const b=JSON.parse('{"title":"OSN安装App常见情况及问题","description":"","frontmatter":{},"headers":[],"relativePath":"azjc/wt/wt.md","filePath":"azjc/wt/wt.md"}'),p={name:"azjc/wt/wt.md"},r=s('<h1 id="osn安装app常见情况及问题" tabindex="-1"><strong>OSN安装App常见情况及问题</strong> <a class="header-anchor" href="#osn安装app常见情况及问题" aria-label="Permalink to &quot;**OSN安装App常见情况及问题**&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">更新时间</p><p>最近更新：2023-10-17</p></div><h3 id="🙋🏻‍♀️-请问哪几款车型支持安装第三方app" tabindex="-1"><strong>🙋🏻‍♀️: 请问哪几款车型支持安装第三方App？</strong> <a class="header-anchor" href="#🙋🏻‍♀️-请问哪几款车型支持安装第三方app" aria-label="Permalink to &quot;**🙋🏻‍♀️: 请问哪几款车型支持安装第三方App？**&quot;">​</a></h3><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>目前支持23款01、03、05车型，领克09、06不支持。</strong></p></div><h3 id="🙋🏻‍♀️-请问破解车机后-会影响质保吗" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问破解车机后，会影响质保吗？ <a class="header-anchor" href="#🙋🏻‍♀️-请问破解车机后-会影响质保吗" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问破解车机后，会影响质保吗？&quot;">​</a></h3><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>此方案不属于破解，安装第三方App就类似安卓手机安装App一样，属于软件层次并非硬件，安装第三方App不会获取最高Root权限（你也获取不到）不会造成硬件损害。</strong></p></div><h2 id="🙋🏻‍♀️-请问目前支持app有哪些" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问目前支持App有哪些？ <a class="header-anchor" href="#🙋🏻‍♀️-请问目前支持app有哪些" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问目前支持App有哪些？&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>从理论上说支持平板模式的App都可以，手机App也可以支持，但效果不佳。（需要在在程序坞显示的App需要改包名）</strong></p></div><h2 id="🙋🏻‍♀️-请问高德地图7-1可以支持hud和仪表盘" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问高德地图7.1可以支持HUD和仪表盘？ <a class="header-anchor" href="#🙋🏻‍♀️-请问高德地图7-1可以支持hud和仪表盘" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问高德地图7.1可以支持HUD和仪表盘？&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>不支持，高德7.1为公测版本不是适配版本，喜欢尝鲜的车友可以下载安装下，追求稳定及极致体验的车友请等待官方更新。</strong></p></div><h2 id="🙋🏻‍♀️-请问安装软件成功后-进入工程模式-设置-选择哪个选项" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问安装软件成功后，进入工程模式-设置 选择哪个选项？ <a class="header-anchor" href="#🙋🏻‍♀️-请问安装软件成功后-进入工程模式-设置-选择哪个选项" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问安装软件成功后，进入工程模式-设置 选择哪个选项？&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>进入工程模式后，在设置里面找到储存选项就可以，后面进入设置就不需要选择了。</strong></p></div><h2 id="🙋🏻‍♀️-请问安装高德地图领克版后-出现未激活该怎么解决" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问安装高德地图领克版后，出现未激活该怎么解决？ <a class="header-anchor" href="#🙋🏻‍♀️-请问安装高德地图领克版后-出现未激活该怎么解决" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问安装高德地图领克版后，出现未激活该怎么解决？&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>拨号键输入进入工程模式，进入设置界面，搜索应用，选择高德地图领克版，所有权限勾选上（包括高级设置），然后选择应用空间清除所有应用数据及缓存，返回桌面 手指从下往上划出现任务栏，选择高德地图领克版并清除，最后打开高德地图领克版就可以正常打开了。（如果此方法无法解决，多尝试几遍或者重新卸载安装，再重复操作以操作）</strong></p></div><h2 id="🙋🏻‍♀️-请问安装高德地图领克版后-如何更换声道及调大声音" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问安装高德地图领克版后，如何更换声道及调大声音？ <a class="header-anchor" href="#🙋🏻‍♀️-请问安装高德地图领克版后-如何更换声道及调大声音" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问安装高德地图领克版后，如何更换声道及调大声音？&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>进入高德地图，点击账户头像，点击右上角设置，选择左侧播报图标并连续点击，出现声音调试后，选择音频频道改成15声道，再选择播放方式为0，退出保存即可。</strong></p></div><h2 id="🙋🏻‍♀️-请问如何在桌面显示app" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问如何在桌面显示App? <a class="header-anchor" href="#🙋🏻‍♀️-请问如何在桌面显示app" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问如何在桌面显示App?&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>在桌面右下方Dock栏App处长按就可以替换App。</strong></p></div><h2 id="🙋🏻‍♀️-请问如何卸载app" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问如何卸载App? <a class="header-anchor" href="#🙋🏻‍♀️-请问如何卸载app" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问如何卸载App?&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>1、可在桌面显示的App,长按卸载即可。</strong></p><p><strong>2、无法在桌面显示的App，需进入工程模式-设置，搜索应用，选择对应的app卸载就行</strong></p><p><strong>3、安装第三方文件关键App，选择你需要卸载的App。</strong></p></div><h2 id="🙋🏻‍♀️-请问软件支持方控和语音" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问软件支持方控和语音? <a class="header-anchor" href="#🙋🏻‍♀️-请问软件支持方控和语音" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问软件支持方控和语音?&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>不支持。后面安装的软件都不是适配版本，无法用语音助手和方向盘操控（车友反馈部分可用）。</strong></p></div><h2 id="🙋🏻‍♀️-请问下载夸克有什么用" tabindex="-1"><strong>🙋🏻‍♀️</strong>: 请问下载夸克有什么用? <a class="header-anchor" href="#🙋🏻‍♀️-请问下载夸克有什么用" aria-label="Permalink to &quot;**🙋🏻‍♀️**: 请问下载夸克有什么用?&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">💬:</p><p><strong>方便后期软件更新及下载，减去用U盘的使用场景。</strong></p></div><p><img src="https://s2.loli.net/2023/10/17/mqnMUrb5xyI1cze.png" alt="image (5)"></p>',25),c=[r];function l(e,i,n,d,h,g){return a(),o("div",null,c)}const m=t(p,[["render",l]]);export{b as __pageData,m as default};
